import React, { useState, useEffect } from 'react';

const Power = () => {
    const [showMore, setShowMore] = useState(false);
    const [currentLoad, setCurrentLoad] = useState(0);
    const [capacity, setCapacity] = useState(0);
    const [motorData, setMotorData] = useState({ frLoad: 0, flLoad: 0, brLoad: 0, blLoad: 0 });
    const [jointData, setJointData] = useState({ j0Load: 0, j1Load: 0, j2Load: 0, j3Load: 0, j4Load: 0, eeLoad: 0 });
    const [labLoadData, setLabLoadData] = useState({ x: 0, y: 0, z: 0, tray: 0, gripper: 0 });

    const toggleMenu = () => {
        setShowMore(!showMore);
    };

    useEffect(() => {
        const interval = setInterval(() => {
            // Function to generate random value in the range [-0.4, 0.4] with step 0.1
            const getRandomValue = () => (Math.random() * 0.8 - 0.4).toFixed(1);

            setMotorData(prevMotorData => {
              const frLoadCalc = parseFloat(prevMotorData.frLoad) + parseFloat(getRandomValue());
              const flLoadCalc = parseFloat(prevMotorData.flLoad) + parseFloat(getRandomValue());
              const brLoadCalc = parseFloat(prevMotorData.brLoad) + parseFloat(getRandomValue());
              const blLoadCalc = parseFloat(prevMotorData.blLoad) + parseFloat(getRandomValue());

              return {
                  frLoad: frLoadCalc.toFixed(1),
                  flLoad: flLoadCalc.toFixed(1),
                  brLoad: brLoadCalc.toFixed(1),
                  blLoad: blLoadCalc.toFixed(1)
              };
          });
            setJointData(prevJointData => ({
                j0Load: parseFloat(prevJointData.j0Load) + parseFloat(getRandomValue()).toFixed(1),
                j1Load: parseFloat(prevJointData.j1Load) + parseFloat(getRandomValue()).toFixed(1),
                j2Load: parseFloat(prevJointData.j2Load) + parseFloat(getRandomValue()).toFixed(1),
                j3Load: parseFloat(prevJointData.j3Load) + parseFloat(getRandomValue()).toFixed(1),
                j4Load: parseFloat(prevJointData.j4Load) + parseFloat(getRandomValue()).toFixed(1),
                eeLoad: parseFloat(prevJointData.eeLoad) + parseFloat(getRandomValue()).toFixed(1)
            }));

            setLabLoadData(prevLabLoadData => ({
                x: parseFloat(prevLabLoadData.x) + parseFloat(getRandomValue()).toFixed(1),
                y: parseFloat(prevLabLoadData.y) + parseFloat(getRandomValue()).toFixed(1),
                z: parseFloat(prevLabLoadData.z) + parseFloat(getRandomValue()).toFixed(1),
                tray: parseFloat(prevLabLoadData.tray) + parseFloat(getRandomValue()).toFixed(1),
                gripper: parseFloat(prevLabLoadData.gripper) + parseFloat(getRandomValue()).toFixed(1)
            }));
        }, 1000);

        return () => clearInterval(interval);
    }, []);

    return (
        <div>

            <div style={{ display: 'flex', alignItems: 'center' }}>
                <h5>Power</h5>
                <div onClick={toggleMenu} style={{ cursor: 'pointer', color: '#A9DFBF', transition: 'transform 0.3s' }}>
                    <span style={{ transform: showMore ? 'rotateZ(90deg)' : 'rotateZ(0)', marginLeft: '0.5rem' }}>&#10148;</span>
                </div>
            </div>

            <table className="table table-striped table-bordered table-hover">
                <thead>
                    <tr>
                        <th scope="col" className="col-6" style={{ backgroundColor: '#1C2833', color: '#A9DFBF' }}>Load</th>
                        <th scope="col" className="col-6" style={{ backgroundColor: '#1C2833', color: '#A9DFBF' }}>Capacity</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <td style={{ backgroundColor: '#1C2833', color: '#A9DFBF' }}>{currentLoad}</td>
                        <td style={{ backgroundColor: '#1C2833', color: '#A9DFBF' }}>{capacity}</td>
                    </tr>
                </tbody>
            </table>

            <div style={{ overflow: 'hidden', transition: 'max-height 0.5s', maxHeight: showMore ? '1000px' : '0' }}>

                Wheels
                <table className="table table-striped table-bordered table-hover">
                    <thead>
                        <tr>
                            <th scope="col" className="col-3" style={{ backgroundColor: '#1C2833', color: '#A9DFBF' }}>FR</th>
                            <th scope="col" className="col-3" style={{ backgroundColor: '#1C2833', color: '#A9DFBF' }}>FL</th>
                            <th scope="col" className="col-3" style={{ backgroundColor: '#1C2833', color: '#A9DFBF' }}>Bl</th>
                            <th scope="col" className="col-3" style={{ backgroundColor: '#1C2833', color: '#A9DFBF' }}>BR</th>
